Evaluate an Angular expression in the context of a given element.
arguments[0] {Element} The element in whose scope to evaluate. arguments[1] {string} The expression to evaluate.
@return {?Object} The result of the evaluation.

Find a list of elements in the page by their angular binding.
arguments[0] {Element} The scope of the search. arguments[1] {string} The binding, e.g. {{cat.name}}. arguments[2] {boolean} Whether the binding needs to be matched exactly. arguments[3] {string} The selector to use for the root app element.
@return {Array.WebElement} The elements containing the binding.

Find elements by model name.
arguments[0] {Element} The scope of the search. arguments[1] {string} The model name.
@return {Array.WebElement} The matching input elements.

Find selected option elements by model name.
arguments[0] {Element} The scope of the search. arguments[1] {string} The model name.
@return {Array.WebElement} The matching select elements.

